func UpdatedAtContainsFold(v string) predicate.ProviderResource {
	return predicate.ProviderResource(sql.FieldContainsFold(FieldUpdatedAt, v))
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ProviderResource) predicate.ProviderResource {
	return predicate.ProviderResource(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ProviderResource) predicate.ProviderResource {
	return predicate.ProviderResource(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ProviderResource) predicate.ProviderResource {
	return predicate.ProviderResource(sql.NotPredicates(p))
}
